import anyacat from './images/anyacat.jpg'
import anyacatobr from './images/anyacatobr.png'

function whowindow () {
    return (
        <>
            <div className='bg-gray-300 border-solid border-2'>
                <p>я хусос занимаюсь хуйней я долбаеб</p>
            </div>
        </>
    )
}

export default function WhoUs() {
    
    function NoteCreate(event) {
        const note = document.getElementById('appleBanner')
        note.style.opacity = 1
        
    }
    
     function NoteDelete(event){
        const note = document.getElementById('appleBanner')
        note.style.opacity = 0
        console.log('on')
    }

    return(
        <>
        <div className='flex conte'>
        <div className=" opacity-0 text-center " id='appleBanner'>Аня я тебя люблю</div>
        <img className='h-96' id='apple' src={anyacat} alt='apple'></img>
        <img className='absolute hover:-translate-y-5 duration-75 h-96' onMouseOver={NoteCreate} onMouseOut={NoteDelete} src={anyacatobr} alt='anya'></img>
        </div>
        </>
    )}
